const analyseFile = require('./file');
const scopeStore = require('../store/scopes');

/**
 * Analyse a file and format into logical flow breakdown.
 *
 * @memberof analyse
 * @param {string} fileSrc - Path to file to analyse.
 *
 * @example
 * analyse('/path/to/file.js');  // returns all scopes
 */
const analyse = fileSrc => {
  analyseFile(fileSrc);

  return JSON.stringify(scopeStore.getAll(), null, 2);
};

module.exports = analyse;

const readFile = require('../utils/readFile');
const entitify = require('../utils/entitify');
const createId = require('../utils/createId');
const Scope = require('../models/Scope');
const fileStore = require('../store/files');
const analyseNode = require('./node');

/**
 * Analyse a file and format into logical flow breakdown.
 *
 * @memberof analyse
 * @param {string} fileSrc - Path to file to analyse.
 *
 * @example
 * analyseFile('/path/to/file.js');  // return analyse
 */
const analyseFile = fileSrc => {

  const id = createId('File');
  const content = readFile(fileSrc);
  const entities = entitify(content);
  const { body } = entities.program;
  const { start, end } = entities;

  fileStore.add({
    id,
    content,
    entities
  });

  const scope = new Scope(start, end, { file: id });

  body.forEach(item => analyseNode(item, scope));

  return scope;
};

module.exports = analyseFile;

/**
 * Analyse a single node. Can be considered as router for other node types.
 *
 * @memberof analyse
 * @param {Object} node - Node to be analysed.
 * @param {Scope} scope - Scope attached to this node.
 * @returns {Array} Array of ids for segment.
 *
 * @example
 * analyseNode(node, scope);  // returns analyse
 */
const analyseNode = (node, scope) => {
  switch (node.type) {
    case 'Identifier':
      return require('./types/identifier')(node, scope);
    case 'RegExpLiteral':
      return require('./types/literals/regex')(node, scope);
    case 'NullLiteral':
      return require('./types/literals/null')(node, scope);
    case 'StringLiteral':
      return require('./types/literals/string')(node, scope);
    case 'BooleanLiteral':
      return require('./types/literals/boolean')(node, scope);
    case 'NumericLiteral':
      return require('./types/literals/numeric')(node, scope);
    case 'VariableDeclaration':
      return require('./types/declarations/variable')(node, scope);
    case 'ReturnStatement':
      return require('./types/statements/controlFlow/return')(node, scope);
    case 'LabeledStatement':
      return require('./types/statements/controlFlow/labeled')(node, scope);
    case 'BreakStatement':
      return require('./types/statements/controlFlow/break')(node, scope);
    case 'ContinueStatement':
      return require('./types/statements/controlFlow/continue')(node, scope);
    case 'BlockStatement':
      return require('./types/statements/block')(node, scope);
    case 'EmptyStatement':
      return require('./types/statements/empty')(node, scope);
    case 'ExpressionStatement':
      return require('./types/statements/expression')(node, scope);
    case 'DebuggerStatement':
      return require('./types/statements/debugger')(node, scope);
    case 'WithStatement':
      return require('./types/statements/with')(node, scope);
    case 'BinaryExpression':
      return require('./types/expressions/binary')(node, scope);
    case 'ExportNamedDeclaration':
      return require('./types/modules/exports/exportNamed')(node, scope);
    case 'BinaryOperator':
      return require('./types/extras/binaryOperator')(node, scope);
    default:
      throw new Error(`Failed to parse, unknown entity type '${node.type}'`);
  }
};

module.exports = analyseNode;

